import React from 'react'
import {Wrapper, H1} from '../Styled';
import Input from './Input'


import styled from "styled-components";

const Form = styled.form`
    border: 2px solid var(--s-3);
    border-radius:.5em;
    padding:1em;
    max-width:40em;
    margin:0 auto;
`

export default function Contact() {
    return (
        <Wrapper>
            <H1>Contact</H1>
            <Form>
                <Input/>
                <Input/>
                <Input/>
                <Button></Button>
            </Form>
        </Wrapper>
    )
}
